import React, { Component } from "react";
import { Button, Input } from "antd";

class Edit extends Component {
  ok = e => {
    console.log(e);
  };
  render() {
    // console.log(this.props.val, this.props.ind);

    return (
      <div>
        <Input
          placeholder="Basic usage"
          size="middle"
          style={{ width: "300px" }}
        />

        <Button type="primary">add</Button>
      </div>
    );
  }
}

export default Edit;
